"""
We have n jobs, where every job is scheduled to be done from startTime[i] to endTime[i], obtaining a profit of
 profit[i].

You're given the startTime, endTime and profit arrays, return the maximum profit you can take such that there are no two
 jobs in the subset with overlapping time range.

If you choose a job that ends at time X you will be able to start another job that starts at time X.
"""
from bisect import bisect
from typing import List


def job_scheduling(start_time: List[int], end_time: List[int], profit: List[int]) -> int:
    """
    1 <= len(start_time) == len(end_time) == len(profit) <= 5e4 tasks

    :param start_time: 1 <= start_time[i] < end_time[i] <= 1e9
    :param end_time: 1 <= start_time[i] < end_time[i] <= 1e9
    :param profit: 1 <= profit[i] <= 1e4
    :return: max profit from these tasks
    """
    # sort tasks by end_time
    jobs = sorted(zip(start_time, end_time, profit), key=lambda task: task[1])
    # max profit ending at time t, in ascending order of t and profit
    max_profit_t = [(0, 0)]
    max_profit_so_far = 0
    for start_i, end_i, profit_i in jobs:
        start_from = bisect(max_profit_t, (start_i + 1,)) - 1
        if max_profit_t[start_from][1] + profit_i > max_profit_so_far:
            max_profit_so_far = max_profit_t[start_from][1] + profit_i
            max_profit_t.append((end_i, max_profit_so_far))
    return max_profit_so_far


